import React from 'react';
import './section.css'
import {Card, CardBody, Col, Row} from "reactstrap";


const Section = () => {
    return (
        <div className='section'>
            <div className='text-center text-white mt-5'>
                <h1>Услуги</h1>
            </div>
            <Row className='m-lg-5'>
                <Col md={4}>
                    <Card>
                        <CardBody className='bg bg-success'>
                            <div className='offset-2 mt-4 ccc-6'>
                                <h1>Разработка <br/>
                                    сайтов</h1>
                                <button><h4> Заказать</h4></button>
                            </div>
                        </CardBody>
                    </Card>
                </Col>

            </Row>
            

            <div className='ccc-5 mt-5'>
                <button className='offset-4 mt-5'><h1>Что даст вашему бизнесу</h1></button>
                <h1 className='text-center text-white '>внедрение Digital-инструментов</h1>
            </div>


        </div>
    );
};

export default Section;
